BitmapType setBitmapEnum(int pressure) {
    if (pressure < 1000)
        return BitmapType::STORM;
    else if (pressure >= 1000 && pressure <= 1010) {
        if (timeinfo->tm_hour >= 8 && timeinfo->tm_hour < 18)
            return BitmapType::SUN_OVERCAST;
        return BitmapType::RAINY;
    }
    else if (pressure > 1010 && pressure <= 1020) {
        if (timeinfo->tm_hour >= 8 && timeinfo->tm_hour < 18)
            return BitmapType::CLOUDY;
        return BitmapType::NIGHT_OVERCAST;
    }
    else if (pressure > 1020)
        return BitmapType::SUNNY;
    else
        return BitmapType::NIGHT;
}

const byte* setBitmap(BitmapType bitmap, int frame) {
    switch (bitmap) {
        case BitmapType::STORM:
            return stormBitmap[frame % FRAME_STORM_COUNT];
        case BitmapType::SUNNY:
            return sunnyBitmap[frame % FRAME_SUNNY_COUNT];
        case BitmapType::CLOUDY:
            return cloudyBitmap[frame % FRAME_CLOUDY_COUNT];
        case BitmapType::RAINY:
            return rainyBitmap[frame % FRAME_RAINY_COUNT];
        case BitmapType::SUN_OVERCAST:
            return sunOvercast[frame % FRAME_SUN_OVER_COUNT];
        case BitmapType::NIGHT_OVERCAST:
            return nightOvercast[frame % FRAME_NIGHT_OVER_COUNT];
        case BitmapType::NIGHT:
            return nightOvercast[frame % FRAME_NIGHT_COUNT];
        default:
            return nullptr;
    }
}